import React from "react";
import {Link} from 'react-router-dom'
import {Flex,VStack,Heading,HStack,IconButton,Spacer} from '@chakra-ui/react'
import { FaSun,FaMoon,FaInstagram,FaGithub,FaLinkedin } from 'react-icons/fa';

import {BrowserRouter, Route, Routes } from 'react-router-dom'

import { useColorMode } from "@chakra-ui/react";

// We import all the components we need in our app

const App = () => {
  const{colorMode,toggleColorMode}=useColorMode()
  const isDark = colorMode ==='dark'
    return (
      <VStack p={5}>
      <Flex w={'100%'} >
        <Heading ml={10} fontWeight='semibold' color={'cyan.400'}>ashiq</Heading>

      <Spacer></Spacer>
      <IconButton ml={1} icon= {isDark ? <FaSun/>:<FaMoon/>}></IconButton>

      <IconButton ml={8} icon= {isDark ? <FaSun/>:<FaInstagram/>}></IconButton>

      <IconButton ml={8} icon= {isDark ? <FaSun/>:<FaGithub/>}></IconButton>

      <IconButton ml={8} icon= {isDark ? <FaSun/>:<FaLinkedin/>}></IconButton>

      </Flex>
     </VStack>
    )
};

export default App;
